import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import UserForm from './components/UserForm';
import AdminDashboard from './components/AdminDashboard';

function App() {
  const [navbarState, setNavbarState] = useState({
    activeTab: 'messages',
    messagesCount: 0,
    unreadCount: 0
  });

  const handleNavbarUpdate = (state) => {
    setNavbarState(state);
  };

  const handleTabChange = (tab) => {
    setNavbarState(prev => ({ ...prev, activeTab: tab }));
  };

  return (
    <Router>
      <div className="App">
        <Navbar 
          activeTab={navbarState.activeTab}
          onTabChange={handleTabChange}
          messagesCount={navbarState.messagesCount}
          unreadCount={navbarState.unreadCount}
        />
        <Routes>
          <Route path="/" element={<UserForm />} />
          <Route path="/admin" element={<AdminDashboard onNavbarUpdate={handleNavbarUpdate} activeTab={navbarState.activeTab} onTabChange={handleTabChange} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
